import styled from "styled-components"

export default function TelaLogin({icon}){
    return(
        <>

        <Icon>
        <img src={icon} alt="icon" />
        </Icon>
        <InputLogin>

        </InputLogin>
        </>
    )
}

const Icon = styled.div`
    display: flex;
    justify-content: center;
    padding: 134px 38px 0 38px;
    img{
        width: 299px;
        height: 49px;
    }
`
